from scipy import stats


def check_significance(metric):
    xg_values = xg[metric]
    dt_values = dt[metric]
    nn_values = nn[metric]

    # Perform pairwise t-tests
    xg_dt = stats.ttest_rel(xg_values, dt_values)
    xg_nn = stats.ttest_rel(xg_values, nn_values)
    dt_nn = stats.ttest_rel(dt_values, nn_values)

    # Print results
    print(f"Metric: {metric}")
    print(f"XGBoost vs Decision Tree: p-value = {xg_dt.pvalue}")
    print(f"XGBoost vs Neural Network: p-value = {xg_nn.pvalue}")
    print(f"Decision Tree vs Neural Network: p-value = {dt_nn.pvalue}")


# Perform significance tests for each metric
metrics = ['auc', 'accuracy', 'precision', 'recall', 'f1']
for metric in metrics:
    check_significance(metric)
